import axios from "axios";
import react,{ useEffect,useState } from "react";
import { useParams } from "react-router-dom";
import personajes from "./PersonajesPages";

const PersonajeDetail = () => {
    const urlPersonajeDetail = ''
    const [PersonajeDetail, setPersonajeDetail] = useState ({});
    let {id} = useParams();
    useEffect (() => {
        const getPersonajeDetail = async () =>{
            const res = await axios.get (urlPersonajeDetail+'/'+id)
            setPersonajeDetail(res.data)

        }
        getPersonajeDetail()
    },[])
    console.log(PersonajeDetail)
    return (<div>
        <div >{PersonajeDetail.title}</div> 
        <img alt="Imagen de filmsDetail" src={PersonajeDetail.image}/>
        <div >{PersonajeDetail.description}</div> 
    </div>)
}





export default PersonajeDetail
